import React from 'react'
import Login from 'Login.js';
import useToken from '.useToken.js';

export default function Dashboard() {
    const { token, setToken } = useToken();

  if(!token) {
    return <Login setToken={setToken} />
  }
    return(
        <h2>Dashboard</h2>
    )
}
